INSERT INTO `messages` VALUES (1, '简介', '<section style=\"text-align:center;\"><section><section><section><p><font size=\"4\">广航羽毛球协会成立于2001年</font></p><p><font size=\"4\">这里大佬云集 热情洋溢</font></p><p><font size=\"4\">我们热爱运动</font></p><p><font size=\"4\">在球场上肆意挥洒汗水</font></p><p><font size=\"4\">我们乐观积极 充满活力</font></p><p><font size=\"4\">不断超越自己 打破极限</font></p><p><font size=\"4\">一路披荆斩棘 取得不少成绩</font></p><p><font size=\"4\">以球会友是我们广航羽协的宗旨</font></p></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><section></section></section></section></section><section><section><section></section></section></section></section><section><section><p><font size=\"4\">荣誉</font></p></section></section><section><section><section><section><section></section></section></section></section><section><section><section></section></section></section></section></section></section><section><section><p><font size=\"4\"><br/></font></p></section></section><section><section><p><font size=\"4\">• 2020年</font></p><p><font size=\"4\">广州市第十四届\"市长杯\"万达体育羽毛球系列大赛获得女子团体第五名、男子团体冠军。</font></p><p><font size=\"4\">• 2019年<br/></font></p><p><font size=\"4\">广州市第十三届\"市长杯\"万家乐羽毛球赛获得第四名。</font></p><p><font size=\"4\">广州市群体通迪卡侬杯获得第五名。</font></p><p><font size=\"4\">• 2018年<br/></font></p><p><font size=\"4\">参加广东省大学生羽毛球锦标赛。</font></p><p><font size=\"4\">• 2017年<br/></font></p><p><font size=\"4\">广州市第十一届\"市长杯\"羽毛球系列大赛获得女子团体第四名、男子团体第四名。<br/></font></p><p><font size=\"4\">四月份参加四校联谊赛，与广生态广工程广药职三校球友进行友好交流，获得第一名的优异成绩。</font></p><p><font size=\"4\">• 2016年<br/></font></p><p><font size=\"4\">广州市第十届\"市长杯\"羽毛球系列大赛获得男子团体第三名。<br/></font></p><p><font size=\"4\">十二月份\"九校联赛\"混合团体羽毛球赛中获得季军。</font></p><p><font size=\"4\">• 2015年<br/></font></p><p><font size=\"4\">获得我校\"优秀学生社团称号\"。</font></p><p><font size=\"4\">广州市第九届\"市长杯\"羽毛球系列大赛获得男子团体第二名。<br/></font></p><p><font size=\"4\">• 2014年<br/></font></p><p><font size=\"4\">广州市第八届\"市长杯\"羽毛球系列大赛获得男子团体第三名。其中，彭嘉俊荣获男单单项第一名，黄俊豪荣获男单单项第三名。<br/></font></p><p><font size=\"4\">• 2013年<br/></font></p><p><font size=\"4\">获得我校\"优秀学生社团称号\"。</font></p></section></section></section></section>', NULL, '简介');
INSERT INTO `messages` VALUES (2, '知识', '<section style=\"text-align:center;\"><section><section><section><p><strong>比赛规则</strong></p></section></section><section><section><p>&nbsp; &nbsp; &nbsp; 可能有很多小伙伴还不清楚羽毛球单打比赛的规则，所以勤劳的小羽就给你们简单讲解下单打比赛需要注意些什么吧</p><p>&nbsp; &nbsp; &nbsp; &nbsp; 如果不清楚规则的话，要注意听裁判的指示噢。</p></section></section><section><section><section></section></section></section></section></section><section style=\"text-align:center;\"><section><section><p><br/></p></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section></section></section></section><section><section><section><section><section><section><section><section><p><strong>一、</strong></p></section></section><section><section><section></section></section></section></section></section></section></section><section><section><p><strong>#</strong><strong>关于比赛场地</strong></p></section></section></section></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><p>首先你们看到是整个羽毛球场地平面剖析图，</p><p>正中间是球网，两端依次是前场发球线，中线，端线以及后场罚球线，两边的线就称为边线。效果图如下：</p><p><br/></p></section></section></section></section></section><section style=\"text-align:center;\"><section><img src=\"data:image/jpeg;base64,\" alt=\"data:image/jpeg;base64,\"/></section></section><section style=\"text-align:center;\"><section><section><p><br/></p></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section></section></section></section><section><section><section><section><section><section><section><section><p><strong>二、</strong></p></section></section><section><section><section></section></section></section></section></section></section></section><section><section><p><strong>#</strong><strong>发球基本规则</strong></p></section></section></section></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><p>其次，在羽毛球中有两种发球方式：</p><p><br/></p><p>①正手发球</p><p><br/></p></section></section><section><section><img src=\"data:image/gif;base64,\" alt=\"data:image/gif;base64,\"/></section></section><section><section><p><br/></p><p>②反手发球</p><p><img src=\"data:image/gif;base64,\" alt=\"data:image/gif;base64,\"/></p></section></section><section><section><br/></section></section></section></section></section><section style=\"text-align:center;\"><section><section><p>下面为发球过程的一些规则：</p></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p>#1</p></section></section></section></section></section></section><section><section><p>发球不能过腰。</p><p>不能把球抛起来打过去!!!</p><p>所谓不能过腰，就是在发球的时候，击球点不能超过你的腰部位置，腰的定义为最低肋骨的下缘。</p><p>发球员的球拍击中球的瞬间，球的任何部分高于最低肋骨的水平线，就是违例了。</p><p>但是呢，一般只要你不是刻意的高发球，是不会判你违例的。</p><p><br/></p><p><br/></p></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p>#2</p></section></section></section></section></section></section><section><section><p>发球一定要在发球区域内发，落在对面有效区域内才算得分！</p><p><br/></p></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p>#3</p></section></section></section></section></section></section><section><section><p>因为发球区和发球有效区域是处于对角线的，所以我们发球也是要对角发球的，不能发在正对面的区域，不然就算出界了，输一分了哦！</p><p><br/></p></section></section></section></section><section style=\"text-align:center;\"><section><p>发球区域和有效区域</p><p>▼</p></section></section><section style=\"text-align:center;\"><section><img src=\"data:image/jpeg;base64,\" alt=\"data:image/jpeg;base64,\"/></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p>#4</p></section></section></section></section></section></section><section><section><p>发球的时候，要等对手准备好再发球，</p><p>不能趁对手不注意的时候偷发过去，</p><p>对手示意好了你再发球，不然就要重发！</p><p>如果是故意偷发，是要收到裁判的警告哦！</p><p><br/></p></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p>#5</p></section></section></section></section></section></section><section><section><p>发球时，遵循“左单右双”原则，</p><p>即在一局比赛开始时（比分 0 ：0）</p><p>或发球方得分为偶数时，</p><p>发球方在右半场进行发球。</p><p>当发球方得分为奇数时，在左半场进行发球&nbsp;</p><p>你们这么聪明我相信左右半场你们是分得清的</p></section><section><section><br/></section></section><section><p><br/></p></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p>#6</p></section></section></section></section></section></section><section><section><p>无论接球还是发球，都只能击打一次，如果击打超过一次，就算违例了。</p><p><br/></p></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p>#7</p></section></section></section></section></section></section><section><section><p>如果球落在有效区域内刚好是在边线上再出了边线，可算得分。</p><p>因为判断出不出界是从球的落地瞬间开始，而不是最终的落地位置。</p><p>emmmm有一句话你们可能没听过：</p><p>“能打在边线上的球都是好球”</p><p><br/></p></section></section></section></section><section style=\"text-align:center;\"><section><section><p><br/></p></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section></section></section></section><section><section><section><section><section><section><section><section><p><strong>三、</strong><br/></p></section></section><section><section><section></section></section></section></section></section></section></section><section><section><p><strong>#</strong><strong>球场礼仪</strong></p></section></section></section></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><p>可能很多小伙伴不知道有一些球场礼仪是我们羽客需要遵守的，这些基本的礼貌能使我们打球更加快乐，更加具有观赏性！</p></section></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p>#1</p></section></section></section></section></section></section><section><section><p><br/></p><p>如果自己杀球不小心杀到对方身上，要举手示意表示抱歉，如果是擦网球得分，也可以举手示意表示谦虚礼貌。<br/></p><p><br/></p></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p>#2</p></section></section></section></section></section></section><section><section><p>比赛过程中不可以对裁判进行恶意攻击（包括精神和身体），有问题可以向裁判长反应，但请尊重每一位裁判！</p><p><br/></p></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p>#3</p></section></section></section></section></section></section><section><section><p>双方球员打完比赛后，要到网前相互握手以示尊重，这体现了“友谊第一比赛第二”的竞技理念。</p></section></section></section></section><section style=\"text-align:center;\"><section><br/></section></section>', NULL, '知识');
INSERT INTO `messages` VALUES (3, '2022年跨年祝福', '<p data-we-empty-p=\"\" style=\"text-align:center;\"><font size=\"4\">上联:搓球🏸挑球🏸勾对角🏸屡屡得分🏸&nbsp;</font></p><p data-we-empty-p=\"\" style=\"text-align:center;\"><font size=\"4\">下联:上网🏸后退🏸弓箭步🏸步步稳健🏸&nbsp;</font></p><p data-we-empty-p=\"\" style=\"text-align:center;\"><font size=\"4\">横批:咋🏸打🏸咋🏸蠃🏸&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</font></p><p data-we-empty-p=\"\" style=\"text-align:center;\"><font size=\"4\">广航羽协祝大家2022\n球技更强🏸突飞猛进🏸阖家欢乐🏸🏸虎年大吉🏸🏸🏸</font><br/></p>', '2021-12-31', '公告');
INSERT INTO `messages` VALUES (87, '2021新生赛临时取消通知', '<h1 style=\"text-align:center;\"><section><p><strong><font size=\"4\">通知</font></strong></p><p><font size=\"4\">&nbsp; &nbsp; &nbsp; &nbsp;各位参赛选手们、裁判员、志愿者们以及活动摄影大家好！</font></p><p><font size=\"4\">&nbsp; &nbsp; &nbsp; 最近疫情的进一步严峻，学校对于疫情防控的要求提高，且更加严格，在学校的要求下广航羽协临时决定取消本周日新生赛活动。</font></p><p><font size=\"4\">&nbsp; &nbsp; &nbsp; 由于新生赛所有赛前准备都已经准备完毕，此次新生赛延期到下学期或者取消，敬请等侯进一步通知。</font></p><p><font size=\"4\">&nbsp; &nbsp; &nbsp; 给大家造成了不便，深感抱歉。</font></p><p><br/></p><p><font size=\"4\">ps：</font></p><p><font size=\"4\">1、关于<strong>统一收取的保险款项，</strong>请扫描二维码添加好友，验证消息发送姓名，通过后发送姓名和身份证号进行核对后，将会退回。</font></p></section><section><p><font size=\"4\">2、<strong>自行购买保险的</strong>，需要自行去投保方网站在会员中心，找到保险订单，然后点开，往下滑，在保单号旁有撤单的按钮，点击撤单。完成退款。</font></p><p><img src=\"data:image/jpeg;base64,\" alt=\"data:image/jpeg;base64,\" style=\"max-width:100%;\" contenteditable=\"false\"/></p><p><br/></p><p><font size=\"4\">希望疫情早日过去</font></p><p><font size=\"4\">疫情就像一场战役</font></p><p><font size=\"4\">千万人更须坚定此战必胜的信心</font></p><p><font size=\"4\">拿出同心抗疫的热忱</font></p><p><font size=\"4\">展现舍我其谁的气魄</font></p><p><font size=\"4\">打赢这场仗</font></p><p><font size=\"4\">恢复正常的学习与生活</font></p><p><font size=\"4\">请广航羽协的朋友们</font></p><p><font size=\"4\">继续做好个人防护</font></p><p><font size=\"4\">戴口罩、勤洗手</font></p><p><font size=\"4\">不聚集、不扎堆</font></p><p><font size=\"4\">关注官方信息</font></p><p><font size=\"4\">不造谣、不信谣、不传谣</font></p><p><font size=\"4\">一起努力</font></p><p><font size=\"4\">为疫情防控尽一份力！</font></p><p><br/></p></section></h1>', '2022-03-26', '公告');
INSERT INTO `messages` VALUES (88, '新生赛比赛规则', '<section style=\"text-align:center;\"><section><section><section><p><strong><font size=\"4\">比赛规则</font></strong></p></section></section><section><section><p><font size=\"4\">&nbsp; &nbsp; &nbsp; 可能有很多小伙伴还不清楚羽毛球单打比赛的规则，所以勤劳的小羽就给你们简单讲解下单打比赛需要注意些什么吧</font></p><p><font size=\"4\">&nbsp; &nbsp; &nbsp; &nbsp; 如果不清楚规则的话，要注意听裁判的指示噢。</font></p></section></section><section><section><section></section></section></section></section></section><section style=\"text-align:center;\"><section><section><p><font size=\"4\"><br/></font></p></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section></section></section></section><section><section><section><section><section><section><section><section><p><strong><font size=\"4\">一、</font></strong></p></section></section><section><section><section></section></section></section></section></section></section></section><section><section><p><font size=\"4\"><strong>#</strong><strong>关于比赛场地</strong></font></p></section></section></section></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><p><font size=\"4\">首先你们看到是整个羽毛球场地平面剖析图，</font></p><p><font size=\"4\">正中间是球网，两端依次是前场发球线，中线，端线以及后场罚球线，两边的线就称为边线。效果图如下：</font></p><p><font size=\"4\"><br/></font></p></section></section></section></section></section><section style=\"text-align:center;\"><section><img src=\"data:image/jpeg;base64,\" alt=\"data:image/jpeg;base64,\" style=\"max-width:100%;\" contenteditable=\"false\"/></section></section><section style=\"text-align:center;\"><section><section><p><font size=\"4\"><br/></font></p></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section></section></section></section><section><section><section><section><section><section><section><section><p><strong><font size=\"4\">二、</font></strong></p></section></section><section><section><section></section></section></section></section></section></section></section><section><section><p><font size=\"4\"><strong>#</strong><strong>发球基本规则</strong></font></p></section></section></section></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><p><font size=\"4\">其次，在羽毛球中有两种发球方式：</font></p><p><font size=\"4\"><br/></font></p><p><font size=\"4\">①正手发球</font></p><p><font size=\"4\"><br/></font></p></section></section><section><section><img src=\"data:image/gif;base64,\" alt=\"data:image/gif;base64,\" style=\"max-width:100%;\" contenteditable=\"false\"/></section></section><section><section><p><font size=\"4\"><br/></font></p><p><font size=\"4\">②反手发球</font></p><p><img src=\"data:image/gif;base64,\" alt=\"data:image/gif;base64,\" style=\"max-width:100%;\" contenteditable=\"false\"/></p></section></section><section><section><font size=\"4\"><br/></font></section></section></section></section></section><section style=\"text-align:center;\"><section><section><p><font size=\"4\">下面为发球过程的一些规则：</font></p></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p><font size=\"4\">#1</font></p></section></section></section></section></section></section><section><section><p><font size=\"4\">发球不能过腰。</font></p><p><font size=\"4\">不能把球抛起来打过去!!!</font></p><p><font size=\"4\">所谓不能过腰，就是在发球的时候，击球点不能超过你的腰部位置，腰的定义为最低肋骨的下缘。</font></p><p><font size=\"4\">发球员的球拍击中球的瞬间，球的任何部分高于最低肋骨的水平线，就是违例了。</font></p><p><font size=\"4\">但是呢，一般只要你不是刻意的高发球，是不会判你违例的。</font></p><p><font size=\"4\"><br/></font></p><p><font size=\"4\"><br/></font></p></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p><font size=\"4\">#2</font></p></section></section></section></section></section></section><section><section><p><font size=\"4\">发球一定要在发球区域内发，落在对面有效区域内才算得分！</font></p><p><font size=\"4\"><br/></font></p></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p><font size=\"4\">#3</font></p></section></section></section></section></section></section><section><section><p><font size=\"4\">因为发球区和发球有效区域是处于对角线的，所以我们发球也是要对角发球的，不能发在正对面的区域，不然就算出界了，输一分了哦！</font></p><p><font size=\"4\"><br/></font></p></section></section></section></section><section style=\"text-align:center;\"><section><p><font size=\"4\">发球区域和有效区域</font></p><p><font size=\"4\">▼</font></p></section></section><section style=\"text-align:center;\"><section><img src=\"data:image/jpeg;base64,\" alt=\"data:image/jpeg;base64,\" style=\"max-width:100%;\" contenteditable=\"false\"/></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p><font size=\"4\">#4</font></p></section></section></section></section></section></section><section><section><p><font size=\"4\">发球的时候，要等对手准备好再发球，</font></p><p><font size=\"4\">不能趁对手不注意的时候偷发过去，</font></p><p><font size=\"4\">对手示意好了你再发球，不然就要重发！</font></p><p><font size=\"4\">如果是故意偷发，是要收到裁判的警告哦！</font></p><p><font size=\"4\"><br/></font></p></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p><font size=\"4\">#5</font></p></section></section></section></section></section></section><section><section><p><font size=\"4\">发球时，遵循“左单右双”原则，</font></p><p><font size=\"4\">即在一局比赛开始时（比分 0 ：0）</font></p><p><font size=\"4\">或发球方得分为偶数时，</font></p><p><font size=\"4\">发球方在右半场进行发球。</font></p><p><font size=\"4\">当发球方得分为奇数时，在左半场进行发球&nbsp;</font></p><p><font size=\"4\">你们这么聪明我相信左右半场你们是分得清的</font></p></section><section><section><font size=\"4\"><br/></font></section></section><section><p><font size=\"4\"><br/></font></p></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p><font size=\"4\">#6</font></p></section></section></section></section></section></section><section><section><p><font size=\"4\">无论接球还是发球，都只能击打一次，如果击打超过一次，就算违例了。</font></p><p><font size=\"4\"><br/></font></p></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p><font size=\"4\">#7</font></p></section></section></section></section></section></section><section><section><p><font size=\"4\">如果球落在有效区域内刚好是在边线上再出了边线，可算得分。</font></p><p><font size=\"4\">因为判断出不出界是从球的落地瞬间开始，而不是最终的落地位置。</font></p><p><font size=\"4\">emmmm有一句话你们可能没听过：</font></p><p><font size=\"4\">“能打在边线上的球都是好球”</font></p><p><font size=\"4\"><br/></font></p></section></section></section></section><section style=\"text-align:center;\"><section><section><p><font size=\"4\"><br/></font></p></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section></section></section></section><section><section><section><section><section><section><section><section><p><font size=\"4\"><strong>三、</strong><br/></font></p></section></section><section><section><section></section></section></section></section></section></section></section><section><section><p><font size=\"4\"><strong>#</strong><strong>球场礼仪</strong></font></p></section></section></section></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><p><font size=\"4\">可能很多小伙伴不知道有一些球场礼仪是我们羽客需要遵守的，这些基本的礼貌能使我们打球更加快乐，更加具有观赏性！</font></p></section></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p><font size=\"4\">#1</font></p></section></section></section></section></section></section><section><section><p><font size=\"4\"><br/></font></p><p><font size=\"4\">如果自己杀球不小心杀到对方身上，要举手示意表示抱歉，如果是擦网球得分，也可以举手示意表示谦虚礼貌。<br/></font></p><p><font size=\"4\"><br/></font></p></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p><font size=\"4\">#2</font></p></section></section></section></section></section></section><section><section><p><font size=\"4\">比赛过程中不可以对裁判进行恶意攻击（包括精神和身体），有问题可以向裁判长反应，但请尊重每一位裁判！</font></p><p><font size=\"4\"><br/></font></p></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><section><section><section><p><font size=\"4\">#3</font></p></section></section></section></section></section></section><section><section><p><font size=\"4\">双方球员打完比赛后，要到网前相互握手以示尊重，这体现了“友谊第一比赛第二”的竞技理念。</font></p></section></section></section></section><section style=\"text-align:center;\"><section><font size=\"4\"><br/></font></section></section><section style=\"text-align:center;\"><section><section><p><font size=\"4\"><br/></font></p></section></section></section><section style=\"text-align:center;\"><section><section><section><section></section></section></section></section><section><section><p><strong><font size=\"4\">结语</font></strong></p></section></section></section><section style=\"text-align:center;\"><section><section><p><font size=\"4\">我们为什么要了解规则呢？</font></p><p><font size=\"4\">因为只有双方都遵守规则，</font></p><p><font size=\"4\">我们才能营造一个公平公正的竞技环境，</font></p><p><font size=\"4\">同时，遵守规则也是尊重对手，尊重自己一种表现。</font></p><p><font size=\"4\">介绍了这么多，相信你们对于比赛规则也有了一定的了解，希望你们能够在新生赛上好好发挥哦！</font></p></section></section></section>', '2022-03-26', '公告');
INSERT INTO `messages` VALUES (89, '2021广州航海学院新生赛', '<p><font size=\"4\">十二月，北风到来。</font></p><p><font size=\"4\">不告诉我们何时有雪。</font></p><p><font size=\"4\">但2021广航羽毛球新生赛告诉你</font></p><p><font size=\"4\">准备好挑战你们的对手吧</font></p><p><font size=\"4\"><br/></font></p><section><section><section><section><section><section><section><p><font size=\"4\">关于比赛</font></p></section></section></section><section><section><section><section><section><section></section></section></section></section><section><section><section><section></section></section></section></section><section><section><section><section></section></section></section></section></section><section><section><section><section><section></section></section></section></section><section><section><section><section></section></section></section></section></section></section></section></section><section><section><section><p><font size=\"4\">比赛时间:</font></p><p><font size=\"4\">2021年12月19日</font></p><p><font size=\"4\">比赛地点:</font></p><p><font size=\"4\">体育馆三楼羽毛球场</font></p><p><font size=\"4\">报名时间:</font></p><p><font size=\"4\">12.11日周日下午三点前</font></p><p><font size=\"4\">报名方式:</font></p><p><font size=\"4\">扫描报名二维码线上报名但需要购买体育运动类保险</font></p><p><font size=\"4\">比赛项目:</font></p><p><font size=\"4\">男子单打 女子单打</font></p><p><font size=\"4\">活动对象:</font></p><p><font size=\"4\">全体大一与专插本大三新生</font></p><p><font size=\"4\">奖项设置:</font></p><p><font size=\"4\">（1）前3名均有证书奖励</font></p><p><font size=\"4\">（2）前3名可获得相应奖品。</font></p></section></section></section></section></section><section><section><section><section><section><section><section><section><section><section></section></section></section></section></section><section><section><p><font size=\"4\">比赛规则</font></p></section></section></section><section><section><section><section><section><section></section></section></section></section><section><section><section><section></section></section></section></section><section><section><section><section></section></section></section></section></section><section><section><section><section><section></section></section></section></section><section><section><section><section></section></section></section></section></section></section></section></section><section><section><section><p><font size=\"4\">本次比赛分为男单，女单两个项目。</font></p><p><strong><font size=\"4\">男单限制32人 女单限制16人</font></strong></p><p><font size=\"4\">比赛分为两个阶段</font></p><p><strong><font size=\"4\"><br/></font></strong></p><p><strong><font size=\"4\">第一阶段（淘汰赛）：</font></strong></p><p><font size=\"4\">根据报名人数合理进行分组，第一阶段进行淘汰赛，分制为<strong>15分一局过</strong>。</font></p><p><font size=\"4\">根据抽签原则对出线的运动员进行手动抽签决定小组赛的对手 。</font></p><p><strong><font size=\"4\"><br/></font></strong></p><p><strong><font size=\"4\">第二阶段（小组赛）：</font></strong></p><p><font size=\"4\">比赛局数调整为16进8与8进4为<strong>21分制一局过胜制</strong>。</font></p><p><font size=\"4\">前四名的争夺实行<strong>21分三局两胜制</strong>。</font></p><p><font size=\"4\">详细规则另行通知</font></p><p><font size=\"4\">报名方式<br/></font></p><section><p><font size=\"4\">扫描下方二维码填写信息报名<br/></font></p></section><section><section></section></section><section><p><font size=\"4\"><br/></font></p><p><strong><font size=\"4\">报名方式</font></strong></p><p><img src=\"data:image/jpeg;base64,\" alt=\"data:image/jpeg;base64,\" style=\"max-width:100%;\" contenteditable=\"false\"/><font size=\"4\"><br/>男子单打</font></p><p><img src=\"data:image/jpeg;base64,\" alt=\"data:image/jpeg;base64,\" style=\"max-width:100%;\" contenteditable=\"false\"/><font size=\"4\"><br/>女子单打</font></p><p><font size=\"4\">由于场地有限报名人数会有限 先报先得&nbsp;</font></p><p><strong><font size=\"4\">请先报名再付保险款项</font></strong></p><p><font size=\"4\"><br/></font></p><p><font size=\"4\"><strong>保险费用</strong>:每位选手都需要自费购买一份<strong>10元</strong>赛事保险。保险将由协会统一为大家购买。(之前发送推文时出现1.自行购买了并且报名了的同学联系负责人进比赛群2.购买了未报名的同学请联系相关负责人处理3.报名了未购买的同学则需重新在此链接报名缴费 )</font></p><p><strong><font size=\"4\">下方为收款码&nbsp;</font></strong></p><p><strong><font size=\"4\">转账请备注姓名 若报名失败款项退回</font></strong></p><p><img src=\"data:image/jpeg;base64,\" alt=\"data:image/jpeg;base64,\" style=\"max-width:100%;\" contenteditable=\"false\"/><font size=\"4\"><br/><b>寄语</b></font></p><p><img src=\"data:image/jpeg;base64,\" alt=\"data:image/jpeg;base64,\" style=\"max-width:100%;\" contenteditable=\"false\"/><font size=\"4\"><br/></font></p><p><font size=\"4\">新生杯，是给自己一个机会。</font></p><p><font size=\"4\">有的时间点，错过一次，</font></p><p><font size=\"4\">就好比是错过一生的遗憾。</font></p><p><font size=\"4\">所以，</font></p><p><font size=\"4\"><strong>2021年新生赛</strong>，我们期待你的到来。</font></p><p><font size=\"4\"><br/></font></p><p><font size=\"4\">期待你们在赛场上的英姿勃发！</font></p><p><font size=\"4\">期待你们在赛场上的挥汗淋漓！</font></p><p><font size=\"4\">期待你们在赛场上的全力以赴！</font></p><p><font size=\"4\">一切的挑战，源于自己内心的勇敢。</font></p><p><font size=\"4\"><br/></font></p><p><font size=\"4\">活动最终解释权归广航羽协</font></p></section></section></section></section></section></section>', '2022-03-26', '公告');
INSERT INTO `messages` VALUES (90, '球员介绍：李宗伟', '<h1><p><font size=\"4\">哈喽，又和大家见面了。本期小羽给大家带来的是来自马来西亚的著名球员李宗伟的介绍，下面让我们回顾李宗伟的生涯吧。</font></p><p><img src=\"data:image/jpeg;base64,\" alt=\"data:image/jpeg;base64,\" style=\"max-width:100%;\" contenteditable=\"false\"/></p><section><section><section><section><section><p><font size=\"4\">李宗伟，1982年10月21日出生于马来西亚槟城，祖籍福建省泉州市南安县,前马来西亚羽毛球男子单打运动员，被誉为马来西亚羽球一哥，是世界羽毛球界四大天王之一</font></p></section></section></section></section></section><section><section><section><section><p><font size=\"4\">他多次登上羽毛球世界排名第一，曾获得世界羽联超级系列赛总决赛男单冠军并在之后获得三连冠，也获得过赫拉特勒斯奖之十杰华裔运动员奖，还受封拿督威拉称号。2019年6月13日正式退役。</font></p><section><section><section><section><section><p><b><font size=\"4\">少年时期</font></b></p></section></section></section></section></section><section><section><section><section><section><p><font size=\"4\">李宗伟从11岁开始练球。有一天，喜欢打羽毛球的爸爸带李宗伟到自己常去的球馆玩，李宗伟好奇地拿起球拍挥了几下，一旁的教练看见这个11岁的男孩虽然其貌不扬，但是身体协调性比一般孩子高出一大截，随即就提出希望收李宗伟为徒，于是李宗伟开始正式学习羽毛球。</font></p><p><font size=\"4\">&nbsp; &nbsp; &nbsp; &nbsp;自此李宗伟开始了他的魔鬼训练生活，并且拥有绝学马来步</font></p><section><section><section><section><section><p><b><font size=\"4\">职业生涯</font></b></p></section></section></section></section></section><section><section><section><section><section><p><font size=\"4\">李宗伟真正开始被更多人认识是他在2004年的马来西亚公开赛拿到男单冠军后，这是他个人第一个公开赛冠军，当年代表大马参加雅典奥运会，在16进8的比赛中输给了陈宏。在2006年，李宗伟世界排名来到第一，成为1980年以来马来西亚第三位世界排名第一的男单选手。</font></p><p><font size=\"4\">李宗伟不仅主宰着自己的羽毛球世界，也支撑着一个国家的荣光。用球迷的话来说，他是拖着一个国家在前进。</font></p></section></section></section></section></section></section></section></section></section></section></section></section></section></section></h1>', '2022-03-26', '新闻');
INSERT INTO `messages` VALUES (91, '2021摆摊招新啦', '<section><section><section><section><p><strong><font size=\"4\"><br/></font></strong></p><p><strong><font size=\"4\">招新信息</font></strong></p><p><strong><font size=\"4\"><br/></font></strong></p></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><p><strong><font size=\"4\">招新时间:</font></strong></p><p><strong><font size=\"4\">10月9日&nbsp; &nbsp; &nbsp;12:30-18:00</font></strong></p><p><strong><font size=\"4\">10月10日&nbsp; &nbsp; 9:30-18:00</font></strong></p><p><font size=\"4\"><strong>欢迎大家来到摊位进行</strong><strong>现场报名</strong><strong>噢</strong></font></p><p><font size=\"4\">=</font><img src=\"data:image/jpeg;base64,\" alt=\"data:image/jpeg;base64,\" contenteditable=\"false\" style=\"max-width: 100%;\"/></p><section><section><section><section><p><font size=\"4\">&nbsp;2021&nbsp;</font></p></section></section><section><section><p><strong><font size=\"4\">★ 招新摊位游戏</font></strong></p></section></section></section></section><section><section><section><section><section><p><font size=\"4\">我们协会有参与社团部的<strong>集章活动</strong></font></p><p><font size=\"4\">报了3种游戏！</font></p><p><font size=\"4\">每个人集满6章可以去社团部那里抽奖！<b></b></font></p><p><font size=\"4\">心动不如行动快来到羽协摊位前一起玩游戏吧</font></p></section></section></section></section></section></section></section></section></section></section>', '2022-03-26', '公告');
INSERT INTO `messages` VALUES (92, '广航体育馆场地介绍', '<section style=\"text-align:center;\"><section><section><section><section><section><p><font size=\"4\">场地介绍</font></p></section></section></section><section><section><section><section><section></section></section></section><section><section><section></section></section></section><section><section><section></section></section></section><section><section><section></section></section></section></section></section><section><section><p><font size=\"4\">&nbsp; &nbsp; &nbsp; 学校羽毛球场地位于南区体育馆三楼，有十个场地，绿色地胶，墙壁有风扇，暂时没有空调。喝水的话，楼梯间有饮水机，还可以去到综合楼超市买，建议打球时自带水。<br/>&nbsp; &nbsp; &nbsp; 场地跑起来可以接受，采光的话要是大白天就不错，碰上阴天的话球馆可能就暗的不行。<br/>&nbsp; &nbsp; &nbsp; 开放时间：全天(21:30闭馆)<br/>&nbsp; &nbsp; &nbsp; 收费标准：免费(人多时需找场管预约)</font></p></section></section></section></section></section><section style=\"text-align:center;\"><section><section><section><section><br/><br/><img src=\"data:image/jpeg;base64,\" alt=\"data:image/jpeg;base64,\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/><br/></section><section><br/></section><section><img src=\"data:image/jpeg;base64,\" alt=\"data:image/jpeg;base64,\" style=\"max-width:100%;\" contenteditable=\"false\"/></section></section></section></section></section>', '2022-03-27', '新闻');
